        function b64ToUint8(b64) {
            const bin = atob(b64);
            const res = new Uint8Array(bin.length);
            for (let i = 0; i < bin.length; i++) res[i] = bin.charCodeAt(i);
            return res;
        }
        async function doUnlock() {
            const pwd = document.getElementById('pw').value;
            const msg = document.getElementById('msg');
            msg.style.display = 'none';
            try {
                let mKeyRaw = null;
                const encoder = new TextEncoder();
                for (let v of [_pkg.userVault, _pkg.adminVault]) {
                    try {
                        const salt = b64ToUint8(v.salt);
                        const iv = b64ToUint8(v.iv);
                        const ct = b64ToUint8(v.ct);
                        const keyMat = await crypto.subtle.importKey("raw", encoder.encode(pwd), "PBKDF2", false, ["deriveKey"]);
                        const key = await crypto.subtle.deriveKey(
                            { name: "PBKDF2", salt, iterations: 100000, hash: "SHA-256" },
                            keyMat, { name: "AES-GCM", length: 256 }, false, ["decrypt"]
                        );
                        const decMKey = await crypto.subtle.decrypt({ name: "AES-GCM", iv }, key, ct);
                        mKeyRaw = b64ToUint8(new TextDecoder().decode(decMKey));
                        break;
                    } catch(e) {}
                }
                if (!mKeyRaw) throw new Error("Key Error");
                const mIv = b64ToUint8(_pkg.mainIv);
                const mCt = b64ToUint8(_pkg.main);
                const mKeyObj = await crypto.subtle.importKey("raw", mKeyRaw, "AES-GCM", false, ["decrypt"]);
                const decrypted = await crypto.subtle.decrypt({ name: "AES-GCM", iv: mIv }, mKeyObj, mCt);
                const result = JSON.parse(new TextDecoder().decode(decrypted));
                window._db = result.db;
                const _originOpen = window.open;
                
                // --- Ê†∏ÂøÉ‰øÆÊ≠£ÔºöÂÑ™ÂÖàÊØîÂ∞çÂ∞ÅË£ùÊ™îÂêç ---
                window.open = function(u) {
                    if(!u || u==='#' || u.startsWith('javascript')) return null;
                    const fileName = decodeURIComponent(u).split('/').pop().split('#')[0].split('?')[0];
                    const f = window._db[fileName] || window._db[decodeURIComponent(fileName)];
                    
                    if(f){
                        const bin = atob(f.data.split(',')[1]);
                        const bytes = new Uint8Array(bin.length);
                        for(let i=0; i<bin.length; i++) bytes[i] = bin.charCodeAt(i);
                        const blobUrl = URL.createObjectURL(new Blob([bytes], {type: f.type==='PDF'?'application/pdf':'text/html'}));
                        _originOpen(blobUrl, '_blank');
                    } else if(u.startsWith('http') || u.startsWith('evernote')){
                        _originOpen(u, '_blank');
                    } else {
                        alert("Ê™îÊ°àÊú™Â∞ÅË£ùÔºö" + fileName);
                    }
                    return null;
                };

                document.open();
                document.write(result.index);
                document.close();
                document.addEventListener('click', e => {
                    const a = e.target.closest('a');
                    if(a && a.getAttribute('href') && a.getAttribute('href')!=='#') {
                        const h = a.getAttribute('href');
                        if(!h.startsWith('javascript')) { e.preventDefault(); window.open(h); }
                    }
                }, true);
            } catch (e) { 
                console.error(e);
                msg.style.display = 'block'; 
            }
        }
        document.getElementById('pw').addEventListener('keypress', e => { if(e.key==='Enter') doUnlock(); });
    </script>
